def associateAssetToNav():
    assetsList = json.loads(get_assets("ASSET_DATABASE_ID"))
    idList = []
    associationTable = []

    for asset in assetsList:
        idList.append(asset["ASSET_DATABASE_ID"]["value"])

    index = 0
    nbIds = len(idList)
    for id in idList:
        index += 1
        quotesJson = get_quotes(id, "2016-06-01", "2016-06-01")
        quotes = json.loads(quotesJson)

        if len(quotes) < 1:
            idList.pop(idList.index(id))
            print("Pop", index)
        else:
            averageNav = 0.0
            for quote in quotes:
                averageNav += float(quote["nav"]["value"].replace(',', '.'))

            averageNav /= len(quotes)
            associationTable.append([id, averageNav])
        print(index, "/", nbIds)

    print(idList)
    print(associationTable)


